import React, { Component } from 'react';
import DropdownButton from "react-bootstrap/DropdownButton";
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Dropdown from "react-bootstrap/Dropdown";

class Dropdowns extends Component {


    onChange() {
        console.log()
    }

    render() {
        return (
            <div class="dropdown-group">
                <ButtonGroup size="lg" block>
                    <DropdownButton
                        as={ButtonGroup}
                        variant={'primary'}
                        title={"Skin Tone: " + this.props.skinTone}
                        id="bg-nested-dropdown">
                            {this.props.options[0].map(option => (
                                <Dropdown.Item eventKey={option.toLowerCase()} onSelect={this.props.onChangeSkinTone}>{option}</Dropdown.Item>
                            ))}
                            {/*<Dropdown.Item eventKey="ns" onSelect={this.props.onChangeSkinTone}>Not Selected</Dropdown.Item>*/}
                            {/*<Dropdown.Divider />*/}
                            {/*<Dropdown.Item eventKey="dark" onSelect={this.props.onChangeSkinTone}>Dark</Dropdown.Item>*/}
                            {/*<Dropdown.Item eventKey="light" onSelect={this.props.onChangeSkinTone}>Light</Dropdown.Item>*/}
                    </DropdownButton>
                    <DropdownButton as={ButtonGroup} variant={'warning'}  title={"Skin Type: " + this.props.skinType} id="bg-nested-dropdown">
                        <Dropdown.Item eventKey="ns" onSelect={this.props.onChangeSkinType}>Not Selected</Dropdown.Item>
                        <Dropdown.Divider />
                        <Dropdown.Item eventKey="oily" onSelect={this.props.onChangeSkinType}>Oily</Dropdown.Item>
                        <Dropdown.Item eventKey="moderate" onSelect={this.props.onChangeSkinType}>Moderate</Dropdown.Item>
                        <Dropdown.Item eventKey="3" onSelect={this.props.onChangeSkinType}>Dry</Dropdown.Item>
                    </DropdownButton>
                    <DropdownButton as={ButtonGroup} variant={'danger'} title={"Eye Color: " + this.props.eyeColor} id="bg-nested-dropdown">
                        <Dropdown.Item eventKey="0">Not Selected</Dropdown.Item>
                        <Dropdown.Divider />
                        <Dropdown.Item eventKey="1">Black</Dropdown.Item>
                        <Dropdown.Item eventKey="2">Brown</Dropdown.Item>
                        <Dropdown.Item eventKey="3">Green</Dropdown.Item>
                        <Dropdown.Item eventKey="4">Blue</Dropdown.Item>
                        <Dropdown.Item eventKey="5">Grey</Dropdown.Item>
                        <Dropdown.Item eventKey="6">White</Dropdown.Item>
                    </DropdownButton>
                </ButtonGroup>
            </div>
        );
    }
}

export default Dropdowns;
